    }
    System.out.println(sb.reverse().toString());
}

public String solution(String s) {
    int index = 0;
    String res = "";
    for (int j = 'z' - 'a' + 1; j >= 0; j--) {
        for (int i = 0; i = index) {
                res += s.charAt(i);
                index = i;
            }
        }
    }
    return res;
}

