2. Add Two Numbers
Input: (2 -> 4 -> 3) + (5 -> 6 -> 4)
Output: 7 -> 0 -> 8
Explanation: 342 + 465 = 807.

ä¸¤ä¸ªé“¾è¡¨ç›¸åŠ ï¼šå¯ä»¥åˆ†ä¸ºæŒ‡é’ˆæ“ä½œå’Œå€¼æ“ä½œï¼ŒæŒ‡é’ˆæœ‰dummy, head, l1, l2ï¼Œåˆ†åˆ«ä»£è¡¨ç»“æœï¼Œl1ï¼Œl2é“¾è¡¨ï¼Œå€¼æ“ä½œåŒ…æ‹¬ä½™æ•°å’Œè¿›ä½é—®é¢˜ï¼Œä¸€ä¸ªæ˜¯%10ï¼Œä¸€ä¸ªæ˜¯/10ï¼Œè¾¹ç•Œæ¡ä»¶åŒ…æ‹¬ä¸‰ä¸ªï¼Œè¿›ä½ä¸º1çš„æ—¶å€™è¿˜è¦åŠ ä¸€æ¬¡carryã€‚
public ListNode addTwoNumbers(ListNode l1, ListNode l2) {
    ListNode dummy = new ListNode(0);
    ListNode head = dummy;
    int carry = 0;
    while (l1 != null || l2 != null || carry == 1) {
        int v1 = (l1 != null) ? l1.val : 0;
        int v2 = (l2 != null) ? l2.val : 0;
        int value = v1 + v2 + carry;
        head.next = new ListNode(value % 10);
        carry = value / 10;

        if (l1 != null) l1 = l1.next;
        if (l2 != null) l2 = l2.next;
        head = head.next;
    }
    return dummy.next;
}

