public int evalRPN(String[] tokens) {
    LinkedList stack = new LinkedList<>();
    for (String token : tokens) {
        if (token.equals("+") || token.equals("-") || token.equals("*") || token.equals("/")) {
            int a = stack.pop();
            int b = stack.pop();
            if (token.equals("+")) {
                stack.push(b + a);
            } else if (token.equals("-")) {
                stack.push(b - a);
            } else if(token.equals("*")) {
                stack.push(b * a);
            } else {
                stack.push(b / a);
            }
        } else {
                stack.push(Integer.valueOf(token));
        }
    }
    return stack.pop();
}

