public int[] singleNumber(int[] nums) {
    int sum = 0;
    Set set = new HashSet<>();
    for (int num : nums) {
        set.add(num);
        sum ^= num;
    }
    for (int num : nums) {
        int other = sum ^ num;
        if (set.contains(other)) return new int[] {num, other};
    }
    return null;
}

