public int[] singleNumber(int[] nums) {
    int diff = 0;
    for (int num : nums) {
        diff ^= num;
    }

    int mask = (diff & -diff);

    int[] res = new int[2];
    for (int num : nums) {
        if ((num & mask) == 0) { 
            res[0] ^= num;
        } else {
            res[1] ^= num;
        }
    }
    return res;
}

